  false,\n\t\"url\": null,\n\t\"notes\": \"Beaver trapping plan and environmental
  assessment for Seedskadee national Wildlife Refuge in WYoming.  Beaver trappinq
  is planned to reduce the damage and destruction to mature cottonwood stands and
  saplings; to minimizentime and money lost in repairing damages caused by beaver
  felled trees; cleaninig blacked irrigation  and water control structures; to reduce
  the potential of contagious or other disease outbreaks; and, in esscence,  to maintain
  \" beaver population at population levels consistent with their habitat and refuge
  management  objectives. This plan intends on only trapping beavers at this time
  as other fur bearers are not a nuisance or abundant enough to merit trapping.\",\n\t\"owner_org\":
